import Map from "./Map";
import Game from "./Game";
import { Box, Modal, Typography } from "@mui/material";

export default function Home() {
  return (
    <React.Fragment>
      <Modal 
        open={true} 
      >    
        <Box>
          <Typography>
            Pokeguesser
          </Typography>
        </Box>
      </Modal>
      <Game />
    </React.Fragment>
  )
}
